import React from 'react'
import './HomeSection.css'
import {Constants} from '../../Utils/ImportFile'

const HomeSection = () => {

  return (
    <div id='Home'>
        <Nav>
        {Constants.NavLinks.map((el)=>(
            <>{el.linkName}</>
        ))}
        </Nav>


    </div>
  )
}

export default HomeSection
